        [TestCategory("Deserialization")]
        [TestMethod]
        public void DeserializeBlockMessageString()
        {
            var messageStr = @"{
                                ""type"":2,
                                ""data"":[
                                    {
                                        ""dataGraphIri"":""http://ex.graph/1"",
                                        ""dataHash"":""a9da1de316235b95584a1918a912361f93f184b7354f8c3efce2469d11c01242"",
                                        ""hash"":""a46749b4a6dae7f162456ccbd963da7e390d59eb0b6837c5fbcb5c2efb1dff77"",
                                        ""index"":""1"",
                                        ""previousBlock"":""http://www.ontologies.makolab.com/bc/GraphChain/0"",
                                        ""previousHash"":""3988e5b919fc7a45accdb150a2d2a591efb2ca73b854e6f2c70e55797c2fdd56"",
                                        ""timestamp"":""1517337315""
                                    },
                                    {
                                        ""dataGraphIri"":""http://ex.graph/2"",
                                        ""dataHash"":""a9da1de316235b95584a1918a912361f94f184b7354f8c3efce2469d11c01242"",
                                        ""hash"":""a46749b4a6dae7f162456ccbd9631a7e390d59eb0b6837c5fbcb5c2efb1dff77"",
                                        ""index"":""1"",
                                        ""previousBlock"":""http://www.ontologies.makolab.com/bc/GraphChain/0"",
                                        ""previousHash"":""a46749b4a6dae7f162456ccbd963da7e390d59eb0b6837c5fbcb5c2efb1dff77"",
                                        ""timestamp"":""1517337315""
                                    }
                                ],
                                ""graph"":{
                                    ""http://ex.graph/1"":"""",
                                    ""http://ex.graph/2"":""""
                                }
                               }";
            var message = Newtonsoft.Json.JsonConvert.DeserializeObject<PeerToPeerMessage>(messageStr);
            Assert.AreEqual(MessageType.RESPONSE_BLOCKCHAIN, message.MessageType);
            Assert.IsNotNull(message.Data);
            Assert.AreEqual(2, message.Data.Count);
            Assert.IsNotNull(message.Graph);
            Assert.AreEqual(2, message.Graph.Count);
        }

        [TestCategory("Deserialization")]
        [TestMethod]
        public void DeserializeQueryMessageString()
        {
            var messageStr = @"{
                                      ""type"":1,
                                      ""data"":[
                                      ],
                                      ""graph"":{
                                      }
                                  }";
            var message = Newtonsoft.Json.JsonConvert.DeserializeObject<PeerToPeerMessage>(messageStr);
            Assert.AreEqual(MessageType.QUERY_ALL, message.MessageType);
            Assert.IsNotNull(message.Data);
            Assert.AreEqual(0, message.Data.Count);
            Assert.IsNotNull(message.Graph);
            Assert.AreEqual(0, message.Graph.Count);
        }

